import './App.css';

import React, { useState } from 'react';

function Title() {
  const handleHover = () => {
    // This function will be called whenever the element is hovered over
    console.log('Hovered over the element');
    // You can perform any actions you want here
  };

  return (
    <div onMouseOver={handleHover}>
      Hover over me!
    </div>
  );
}

function App() {
  return (
    <Title/>
  );
}

export default App;
